import React from "react";
import style from "./NewsPage.module.css";
import svg1 from "./../../assets/svg/svg1.svg";
const NewsPage = () => {
  return (
    <div className={style.container}>
      <img src={svg1} className={style.svg1} alt="" />
    </div>
  );
};

export default NewsPage;
